import React from 'react';
import '../../css/header.css';
import {connect} from "react-redux";
import Header from "./header";
import {auth, authMe} from "../../redux/authReducer";
import js from 'http://kenguruexpress.loc/js/centrifuge.min.js';
class HeaderCont extends React.Component {

    componentDidMount() {
        let centrifuge = new js.Centrifuge('ws://192.168.3.105:8000/connection/websocket');

        centrifuge.subscribe("calc", function(message) {
            console.log(message);
        });

        // let btn = document.getElementById("btnSend");
